onmessage = (n) => {
    if (n.data !== undefined) {
        ("use strict");
        var t = new XMLHttpRequest();
        t.open(n.data.method, n.data.url, !0);
        t.setRequestHeader("Content-type", "application/json;");
        t.setRequestHeader("RequestVerificationToken", n.data.token);
        t.setRequestHeader("x-Requested-With", "XMLHttpRequest");
        t.setRequestHeader("accept", "application/json, text/javascript, */*; q=0.01");
        t.responseType = "text";
        t.timeout = 12e5;
        t.onloadend = () => {
            if (t.readyState === 4)
                if (t.status === 200)
                    try {
                        let n = JSON.parse(t.response);
                        postMessage({ status: !0, response: n });
                    } catch (n) {
                        postMessage({ status: !1, response: "Network Error. Please Contact Your Administrator.", isNetworkError: !0 });
                    }
                else
                    t.status === 401
                        ? postMessage({ status: !1, response: t.response, code: 401 })
                        : t.status === 500 && n.data.method === "POST"
                        ? postMessage({ status: !1, response: "Sderver Error. Please Contact Hanmak Technologies." })
                        : n.data.method === "POST"
                        ? postMessage({ status: !1, response: t.response })
                        : postMessage({ status: !0, response: null });
        };
        t.onerror = () => {
            postMessage({ status: !1, response: "Network Error. Please Contact Your Administrator.", isNetworkError: !0 });
        };
        t.ontimeout = () => {
            postMessage({ status: !1, response: "Connection Timeout. Please Try Again.", isNetworkError: !0 });
        };
        t.send(JSON.stringify(n.data.data));
    }
};
